import { CircularProgressbar } from '@rhazegh/react-circular-progressbar';
import React from 'react'

const Test = () => {
    const percentage = 90;
    return (
        <div className='dcmm'>
            <CircularProgressbar value={percentage} text={`${percentage}%`} />;
        </div>
    )
}

export default Test
